import React from 'react';
import RectangularPicture from '../images/gallery1.png'; // Importing rectangular picture
import CirclePicture from '../images/gallery2.png'; // Importing circle picture

const Tickets = () => {
  return (
    <div className="relative w-full h-full">
      {/* Rectangular shape picture */}
      <img
        src={RectangularPicture}
        alt="Rectangular Shape Picture"
        className="w-full h-96 m-12 object-cover rounded-lg"
      />
      {/* Circle shape picture overlapping */}
      <div className="absolute inset-0 flex justify-center items-center flex-col-reverse">
        <div className="mb-12">
          <p className="text-lg font-bold">JOLLOF SUMMIT</p>
          <p className="text-sm">Location: GHION HOTEL, Addis Ababa</p>
          <p className="text-sm">Date: Wed, 6th March 2024</p>
          <p className="text-sm">Time: 10:00 am - 9:00 pm</p>
          <button className="bg-blue-500 text-white py-2 px-4 rounded hover:bg-blue-600">
            Upcoming in 92 day(s)
          </button>
        </div>
        <img
          src={CirclePicture}
          alt="Circle Shape Picture"
          className="w-64 h-64 object-cover rounded-full border-4 border-white"
          style={{marginTop: '600px'}}
        />
      </div>
    </div>
  );
};

export default Tickets;
